function batch(bigArray) {
    const batches = [];
    const batchSize = 100;

    for (let i = 0; i < bigArray.length; i += batchSize) {
        batches.push(bigArray.slice(i, i + batchSize));
    }

    return batches;
}

exports.seed = async function(knex) {
    await knex('posts').del();

    for (const postBatch of batch(posts)) {
        await knex('posts').insert(postBatch);
    }
};
